import React, { Component } from 'react';
import { Media, Container, Col, Row, Button, Form, FormGroup, Label, Input, FormText } from 'reactstrap';

class App extends Component {
  render() {
    return (
      <Container>
        <Col sm={{ size: 'auto', offset: 4 }}>
          <form class='loginForm'>
            <Media left href="#">
               <Media object data-src="http://mainenordmenn.com/wp-content/uploads/2017/09/Maine-Nordmenn-Board-Generic-Profile.jpg" alt="Generic placeholder image" />
            </Media>

            <FormGroup>
              <Input type="email" name="email" id="exampleEmail" placeholder="Email" />
            </FormGroup>

            <FormGroup>
              <Input type="password" name="password" id="examplePassword" placeholder="Password" />
            </FormGroup>

            <FormGroup>
              <Button color="primary" size="me" block>Login</Button>
            </FormGroup>
          </form>
        </Col>
      </Container>
    );
  }
}

export default App;
